    false,nt"url": null,nt"notes": "Marine bird populations in Prince William
    Sound, Alaska, were censused in the winter and summer of 1972 and 1973 to assess
    the potential impact of oil transport operations resulting from construction of
    the Trans-Alaska Pipeline. The principal groups of birds present in order of abundance
    in the winter were sea ducks, gulls, and alcids. In the summer the same three groups
    were dominant; but gulls were most abundant, with alcids and sea ducks second and
